import * as React from "react";
import { useTable } from "react-table";


const workspace = () => {
    const columns = React.useMemo(
        () => [
            {
                Header: "ID",
                accessor: "id",
            },
            {
                Header: "Name",
                accessor: "name",
            },
            {
                Header: "slug",
                accessor: "description",
            },
        ]);

};

export default workspace
